import { faCheckCircle } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import classNames from 'classnames/bind';
import styles from './AccountItem.module.scss';

const cx = classNames.bind(styles);

function ACcountItem() {
    return (
        <div className={cx('wrapper')}>
            <img
                className={cx('avatar')}
                src="https://images.search.yahoo.com/search/images;_ylt=Awrg0LttQ9Zjy1sPSTyJzbkF;_ylu=c2VjA3NlYXJjaARzbGsDYnV0dG9u;_ylc=X1MDOTYwNjI4NTcEX3IDMgRmcgNtY2FmZWUEZnIyA3A6cyx2OmksbTpzYi10b3AEZ3ByaWQDZjNORk5ucDNRZnVpalQyUjN6VGlkQQRuX3JzbHQDMARuX3N1Z2cDMTAEb3JpZ2luA2ltYWdlcy5zZWFyY2gueWFob28uY29tBHBvcwMwBHBxc3RyAwRwcXN0cmwDMARxc3RybAMxMARxdWVyeQNhdmF0YXIlMjBkZXAEdF9zdG1wAzE2NzQ5ODYzNTY-?p=avatar+dep&fr=mcafee&fr2=p%3As%2Cv%3Ai%2Cm%3Asb-top&ei=UTF-8&x=wrt&type=E210US91215G0#id=30&iurl=http%3A%2F%2Fi.9mobi.vn%2Fcf%2Fimages%2F2015%2F04%2Fnkk%2Fhinh-avatar-dep-11.jpg&action=click"
                alt="Quan"
            />
            <div className={cx('info')}>
                <p className={cx('name')}>
                    <span>Duong Minh Quan</span>
                    <FontAwesomeIcon icon={faCheckCircle} />
                </p>
                <span className={cx('username')}>duongminhquan</span>
            </div>
        </div>
    );
}
export default ACcountItem;
